import logo from "./logo.svg";
import "./App.css";
import Header from "./Home/Header";
import Footer from "./Home/Footer";
import { Route, Routes } from "react-router-dom";
import routes from "./Home/routes";

function Test(props) {
  return <>Test {props.t} </>;
}

function App() {
  return (
    <div className="App">
      <Header />

      <Routes>
        {routes.map((r, i) => {
          <Route key={i} path={r.path} element={<Test t={r.component} />} />;
        })}
      </Routes>

      <Footer />
    </div>
  );
}

export default App;
